VALUES ('3366760042085', 'Paupiette de veau sauce tomate et tagliatelles aux œufs', 'pâtes cuites aux œufs 36% (eau, semoule de _BLÉ_ dur, _ŒUF_), paupiette de veau 25% (viande de porc 15 % (origine France), enveloppe de veau 8% (origine : France), eau, oignon, sel, épices, plantes aromatiques, poireau, arôme naturel de poivre, arôme naturel de muscade], concassé de tomate à la purée de tomate 23% (tomate pelée concassée, purée de tomate), eau, oignon préfrit (oignon, huile de tournesol), champignon de Paris (champignon de Paris, eau, sel, acidifiants acide citrique, acide ascorbique), double concentré de tomate 1%, huile de tournesol, vin blanc, lardon cuit fumé 0,8% [poitrine de porc 0,7% (origine France), sel, dextrose, antioxydant érythorbate de sodium, conservateur nitrite de sodium], huile d\'olive vierge, farine de _BLÉ_, gélatine de bœuf, pulpe d\'ail, sucre, persil lyophilisé, sel, persil, conservateur sorbate de potassium. Soit 35% de sauce tomate dans le produit.', 'https://static.openfoodfacts.org/images/products/336/676/004/2085/front_fr.4.400.jpg', '6.4', '1.8', '12', '2.1', '', '7.4', '0.56', '0.220472440944882', '', '1');

