INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3366760043594', '8 raviolis vapeur', 'Hacao aux crevettes (8x25g): 26,5% crevette (crevette eau, sel, sulfites), eau, fécule de manioc, amidon de blé, chataigne d\'eau vemicelle réhydraté (eau, amidon de pois), pousse de bambou, ciboule, carotte, purée d\'ail, huile de tournesol, sel, sucre, huile de sésame, blanc d\'euf en poudre, poivre. (pourcentage exprimé sur l\'hacao). Sauce aigre-douce (20g): eau, sucre, vinaigre d\'alcool, poivron rouge amidon transformé, jus d\'ananas concentré, sel, huile de colza, sauce soja (eau, graines de soja, sel, farine de blé), épices, épaississants: gomme guar et gomme xanthane, gingembre. Sauce soja (20g): eau, 35% sauce soja (eau, graines de soja, sel, farine de ble), sucre, jus de citron concentre, épaississants: gomme guar et gomme xanthane. (pourcentage exprimé sur la sauce).', 'https://static.openfoodfacts.org/images/products/336/676/004/3594/front_fr.4.400.jpg', '1.9', '0.3', '23', '1.4', '', '5.4', '1.1', '0.433070866141732', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3366760043600', 'Banh bao porc et coriandre', 'farine de blé, eau, 13,8% viande de porc (Origine: France), oignon préfrit (oignon, huile de tournesol), chataigne d\'eau, carotte, protéine de soja réhydratée, sucre, oignon, gras de porc, sauce soja (eau, graines de soja, sel, farine de blé), amidon transformé de pomme de terre, 1,8% coriandre, beurre (contient lait), sel, levure sèche (émulsifiant : E491), poudres à lever: E450, E500, amidon de blé, lait entier en poudre.', 'https://static.openfoodfacts.org/images/products/336/676/004/3600/front_fr.4.400.jpg', '8.8', '3.2', '29', '5', '', '6.9', '1.4', '0.551181102362205', '', '0');

