INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3366760044058', 'Pavé de Saumon et pâtes aux légumes verts', 'Pâtes aux _oeufs_ cuites 32% (eau, semoule de _blé_ dur, _oeufs_ 3%), pavé de filet de _saumon_ 20%, haricot vert 16%, courgette grillée 16%, basilic 4%, huile d’olive vierge 3%, eau, huile de tournesol, pulpe d’ail 0,9%, _parmigiano reggiano_ râpé 0,8%, poudre d’_amande_, sel, extrait d’épinard, amidon de maïs.', 'https://static.openfoodfacts.org/images/products/336/676/004/4058/front_fr.15.400.jpg', '8.5', '1.3', '12', '0.8', '1.5', '7.4', '0.58', '0.228346456692913', '0', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3366760044065', 'Tajine de poulet aux légumes, olives et amandes', 'Aiguillette de poulet assaisonnée rôtie 23% [aiguillette de poulet (origine : France), eau, fécule de manioc, sel], eau, pomme de terre 16%, carotte 8%, courgette grillée 8%, oignon préfrit 6% (oignon, huile de tournesol), olive verte 5%, pois chiche 3%, _amande_ effilée 1%, jus de citron, amidon, concassé de tomate à la purée de tomate 0,8% (tomate pelée concassée, purée de tomate), huile d’olive vierge, sel, épices 0,3% (cumin, curcuma), gingembre 0,2%, pulpe d’ail, coriandre, miel.', 'https://static.openfoodfacts.org/images/products/336/676/004/4065/front_fr.14.400.jpg', '3.6', '0.5', '6.5', '1.2', '1.5', '6.3', '0.6', '0.236220472440945', '0', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3366760044072', 'Risotto aux champignons, fèves et petits pois', 'Eau, _crème_ fraîche, champignon de Paris 16%, riz 13%, fève de _soja_ 12%, petit pois 7%, échalote, _parmigiano reggiano_ râpé, cèpe 1%, huile de tournesol, farine de _blé_, amidon de maïs, sel, vinaigre d’alcool, ail en poudre, oignon en poudre, poivre.', 'https://static.openfoodfacts.org/images/products/336/676/004/4072/front_fr.20.400.jpg', '8.2', '4.1', '15', '1.3', '1.7', '4.9', '0.65', '0.255905511811024', '0', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3366760044089', 'Poulet korma', 'Riz cuit 22% (eau, riz), aiguillette de poulet assaisonnée rôtie 20% [aiguillette de poulet (origine : France), eau, fécule de manioc, sel], eau, lentille verte cuite 6%, poivron rouge 5%, courgette grillée 5%, oignon préfrit 5% (oignon, huile de tournesol), fève 5%, _crème_ fraîche, lait de noix de coco 2% (lait de noix de coco, eau), double concentré de tomate, _yaourt_ maigre en poudre 1%, huile de tournesol, sel, sucre, gingembre, amidon, coriandre, épices curry 0,2% (curcuma, coriandre, graine de _moutarde_, fenugrec, cumin, piment fort), poudre d\'_amande_, curcuma.', 'https://static.openfoodfacts.org/images/products/336/676/004/4089/front_fr.13.400.jpg', '4.3', '1.9', '12', '2.4', '1.3', '7', '0.66', '0.259842519685039', '0', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3366760044096', 'Tikka masala aux légumes, mélange de riz, quinoa et lentilles', 'Eau, riz cuit (eau, riz), quinoa cuit 16%, _crème_ fraîche, carotte 9%, courgette grillée 9%, lentille verte cuite 6% (eau, lentille), épinard 6%, raisin sec 1% (raisin, huile de coton), farine de _blé_, double concentré de tomate, huile de tournesol, gingembre, _yaourt_ maigre en poudre 0,6%, épices 0,5% (paprika, coriandre, cumin, piment fort, curcuma), sel, sauce _soja_ (eau, graine de _soja_, sel, farine de _blé_), pulpe d’ail, vinaigre d’alcool, coriandre, amidon de maïs, oignon en poudre, graine de _sésame_.', 'https://static.openfoodfacts.org/images/products/336/676/004/4096/front_fr.20.400.jpg', '4.8', '2.2', '15', '2.8', '1.7', '3.5', '0.66', '0.259842519685039', '0', '1');

